@app.route("/checkout")
def checkout1():
    return '''
    <!doctype html>
<html lang="en">
<head>
    <title>Checkout</title>
    <style>
        body {
            background-color: black; /* Black background */
            display: flex;
            justify-content: center; /* Center horizontally */
            align-items: center; /* Center vertically */
            height: 100vh; /* Full viewport height */
            margin: 0; /* Remove default margin */
            font-family: Arial, sans-serif; /* Arial font */
        }

        .container {
            background-color: white; /* White background for container */
            padding: 30px;
            border-radius: 10px;
            box-shadow: 0 0 20px rgba(0, 0, 0, 0.2); /* Subtle shadow */
            text-align: center;
            max-width: 90%;
            width: 400px;
        }

        h1 {
            color: #333; /* Dark gray color */
            margin-bottom: 20px;
            font-size: 24px; /* Increased font size */
        }

        label {
            color: #333; /* Dark gray color */
            display: block; /* Block display for better alignment */
            margin-bottom: 10px; /* Space below label */
            font-size: 18px; /* Font size for label */
        }

        input[type="text"] {
            width: calc(100% - 22px); /* Full width minus padding */
            padding: 10px; /* Padding inside input */
            border-radius: 5px; /* Rounded corners */
            border: 1px solid #ccc; /* Light gray border */
            font-size: 16px; /* Font size for input text */
            margin-bottom: 20px; /* Space below input */
        }

        button {
            background-color: #4CAF50; /* Green background */
            border: none;
            color: white; /* White text */
            padding: 15px 32px; /* Padding inside button */
            text-align: center;
            text-decoration: none;
            display: inline-block;
            font-size: 16px; /* Font size */
            margin: 4px 2px; /* Margin around button */
            cursor: pointer;
            border-radius: 10px; /* Rounded corners */
            transition-duration: 0.4s;
        }

        button:hover {
            background-color: #45a049; /* Darker green on hover */
        }
    </style>
</head>
<body>
<div class="container">
    <h1>It's Cash on delivery or card scan on Delivery</h1>
    <h1>What are you buying? ex. Product1, Product 2</h1>
    <form action="/products">
    <label for="product">Product</label>
    <input type="text" id="product" placeholder="Enter Product Number">
    <label for="address">Address</label>
    <input type="text" id="address" placeholder="Enter Delivery Address">
    <button type="submit">Submit</button>
    </form>
</div>
</body>
</html>
'''


